import React from 'react';
import { Container } from 'react-bootstrap';
import Cabecalho from '../componentes/cabecalho';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles.css'
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';
import logoSala from './logoSala.png'
import logoFuncionario from './logoFuncionario.png'

function Index() {
  return (

    <Container fluid>
      <Cabecalho/>
      <Navbar   bg="warning" variant="dark" className="intranet" > 
    <Nav   defaultActiveKey="/home" as="ul">
          <Navbar.Brand   href="/listasalas">
            <img
              src={logoSala}
              width="20"
              height="20"
              className="d-inline-block align-bot"
              alt="Sala logo"
            />
          </Navbar.Brand>
          <Navbar.Brand   href="/listafuncionarios">
            <img
              src={logoFuncionario}
              width="20"
              height="20"
              className="d-inline-block align-bot"
              alt="Sala logo"
            />
          </Navbar.Brand>
    </Nav>
    </Navbar>
    </Container>
 
      )
      };

export default Index;
